import React, { useEffect, useState } from 'react'
import { Link,useNavigate, useParams }  from "react-router-dom";
import FormAdmin from '../components/FormAdmin';
export default function Adminform() {
  let { id } = useParams();
  const navigate = useNavigate();
  const [state, setState]= useState({});
  useEffect(() => {
    //setState({...state, loading:true});
    //axios.get('books/'+id)
    //.then((result) => setState({...result.data.data,error:null,loading:false}))
    //.catch((err) => setState({error: err.response.data.error.message, loading:false}));
    setState({id:id});
  },[]);
  return (
    <div class="content-wrapper">
      <div className="content-header">
        <div className="container-fluid">
          <div className="row mb-2">
            <div className="col-sm-5">
              <h1 className="m-0">Админ хэрэглэгч нэмэх</h1>
            </div>{/* /.col */}
            <div className="col-sm-2">
            <button type="button" class="btn btn-block btn-primary btn-sm" onClick={()=>navigate("../admin")}>Буцах{state.id}</button>
            </div>
          </div>{/* /.row */}
        </div>{/* /.container-fluid */}
      </div> 
      <div className="content">
        <div className="container-fluid">
          <div className="row">
            <FormAdmin/>
          </div>
        </div>
      </div>
    </div>
  )
}
